// SPDX-License-Identifier: MIT
pragma experimental ABIEncoderV2;
pragma solidity >=0.4.22 <0.9.0;

library SharedStructs {
    struct Property {
        string title;
        string description;
        uint256 montlyPrice;
        uint256 deposit;
        address payable currentTenant;
    }
}

contract RealEstateProperty {
    address public owner;

    uint256 numProperties;
    mapping(uint256 => SharedStructs.Property) properties;

    constructor(address _owner) public {
        owner = _owner;
    }

    modifier onlyOwner(address _owner) {
        require(owner == _owner, "Not authorized.");
        _;
    }

    function getProperties()
        public
        view
        returns (SharedStructs.Property[] memory)
    {
        SharedStructs.Property[]
            memory memoryArray = new SharedStructs.Property[](numProperties);
        for (uint256 i = 0; i < numProperties; i++) {
            memoryArray[i] = properties[i];
        }
        return memoryArray;
    }

    function createProperty(
        string memory _title,
        string memory _description,
        uint256 _montlyPrice,
        uint256 _deposit
    ) public {
        uint256 propertyID = numProperties++;
        SharedStructs.Property storage p = properties[propertyID];
        p.title = _title;
        p.description = _description;
        p.montlyPrice = _montlyPrice;
        p.deposit = _deposit;
    }
}

contract RealEstatePropertyFactory {
    mapping(address => RealEstateProperty) public properties;
    uint256 private numProperties;
    struct Property {
        string title;
        string description;
        uint256 montlyPrice;
        uint256 deposit;
        address payable currentTenant;
    }

    function getRealEstateProperty(address _propertyOwner)
        public
        view
        returns (SharedStructs.Property[] memory)
    {
        return properties[_propertyOwner].getProperties();
    }

    // Owners create a real state property
    function createRealEstateProperty(
        string memory _title,
        string memory _description,
        uint256 _amount,
        uint256 _deposit
    ) public {
        RealEstateProperty property = new RealEstateProperty(msg.sender);
        properties[msg.sender] = property;
        numProperties++;
        property.createProperty(_title, _description, _amount, _deposit);
    }
}
